import React, {useEffect, useState} from 'react';
import ChooseArea from "../Components/ChooseArea/ChooseArea";
import FormRegister from "../Components/FormRegister/FormRegister";
import ManageArrow from "../Components/ManageArrow/ManageArrow";
import checkService from "../API/checkService";
import {useNavigate} from "react-router-dom";

const Check = () => {

    const [courses, setCourses] = useState([])
    const [course, setCourse] = useState({id: "", name: "", semester: "", config: "", email: "", github: "", })
    const [groups, setGroups] = useState([])
    const [group, setGroup] = useState("")
    const [labs, setLabs] = useState([])
    const [lab, setLab] = useState("")
    const [message, setMessage] = useState("")
    const [result, setResult] = useState("")
    const [fullUserData, setFullUserData] = useState({surname: "", name: "", patronymic: "", github: ""})
    const [filter, setFilter] = useState("")
    const [pageChoose, setPageChoose] = useState(1)

    const allOpt = [course, group, lab]

    const router = useNavigate()
    const callback = () => {
        checkService.postRegister(course, group, {...fullUserData}).then(async a => {
            console.log(a)
            setMessage(a.message)
            if (a.status === 202) {
                setPageChoose(pageChoose + 1)
            }

        })
    }

    const FetchInfo = () => {
        if(pageChoose === 1){
            if (courses.length === 0) {
                checkService.getCourses().then(a => setCourses(a))
            }
            setGroups([]);
            setGroup("")
            setLabs([])
            setLab("")
            setMessage("")
            setResult("")
            router('/courses')
        }
        else if(pageChoose === 2){
            if (groups.length === 0) {
                checkService.getGroups(course.id).
                then(res => {setGroups(res)
                    setCourses([])
                })
            }
            setLabs([])
            setLab("")
            setMessage("")
            setResult("")
            router(`/courses/${course.id}/groups`)
        }
        else if(pageChoose === 3){
            if (labs.length === 0) {
                checkService.getLabs(group).
                then(res => {
                    setLabs(res)
                    setGroups([])
                })
            }
            setMessage("")
            setResult("")

            setFullUserData({surname: "", name: "", patronymic: "", github: ""})
            document.getElementsByClassName("form")[0].style = "display: none"
            router(`/courses/${course.id}/groups`)
        }
        else if(pageChoose === 4){
            setLabs([])
            setMessage("")
            setResult("")
            document.getElementsByClassName("form")[0].style = "display: flex"
            document.getElementsByClassName("chooseDiv")[0].style = "overflow-y: scroll"
            router(`/courses/${course.id}/groups`)
        }
        else if(pageChoose === 5){
            document.getElementsByClassName("form")[0].style = "display: none"
            document.getElementsByClassName("chooseDiv")[0].style = "overflow: hidden"
            checkService.postGrade(course, group, lab, fullUserData.github).then(a => {
                setResult(a.message)
            })

        }


    }

    useEffect(() => {
        FetchInfo()
    }, [pageChoose])


    return (
        <>
            <div className={"head"}>
                Check Lab
            </div>

            <div className={"userDiv"}>

                <div className={"userChoose"} style={course.name.length<=0 ? {display: "none"} : {}}>
                    {course.name.length > 0 ? <div>{course.name} ({course.semester})</div> : null}
                    {group.length > 0 ? <div>{group}</div> : null}
                    {lab.length > 0 ? <div>{lab}</div> : null}
                </div>

                <div className={"chooseParentDiv"}>
                    <div className="inpDiv">
                        {pageChoose < 4 && <input className={"inpFilter"} placeholder={"Введите название..."} value={filter} onChange={(e) => setFilter(e.target.value)}/>}
                        {message && pageChoose === 4 && <div className={"mes"}>{message}</div>}
                    </div>

                    <div className={"chooseDiv"}>
                        <ChooseArea allOpt={allOpt} strfilt={filter} groups={groups} setGroup={setGroup} courses={courses} setCourse={setCourse} labs={labs} setLab={setLab}/>
                        <FormRegister fullUserData={fullUserData} setFullUserData={setFullUserData}/>
                        <div className="result">{result}</div>
                    </div>
                    <div className={"parentArrow"}>
                        <ManageArrow FUD={fullUserData} setFilter={setFilter} allOpt={allOpt} setPageChoose={setPageChoose} pageChoose={pageChoose} callback={callback}/>
                    </div>
                </div>
            </div>
        </>
    );
};

export default Check;
